(5182,	'0966868139',	NULL,	NULL,	'2021-12-28',	'Làm website kiếm tiền online:\r\n\r\n* Tính năng web người dùng:\r\n- Đăng ký, đăng nhập ( cần admin duyệt tài khoản sau khi đăng ký)\r\n- Nhiệm vụ: danh sách các link được admin gửi, click vào link để làm nhiệm vụ, xong tích chọn hoàn thành nhiệm vụ\r\n- Ví: cộng 5.000đ khi hoàn thành mỗi nhiệm vụ; tạo yêu cầu rút tiền gửi về admin\r\n- Tin tức/ sự kiện: hiển thị các tin tức mới do admin đăng\r\n- banner: hiển thị các banner do admin đăng\r\n- Tài khoản cá nhân: đổi avatar, đổi mật khẩu, đăng xuất\r\n* Tính năng web admin:\r\n- Quản lý tài khoản user: thêm, sửa, xóa, kích hoạt, ngừng kích hoạt\r\n- Quản lý nhiệm vụ: têm, sửa, xóa nhiệm vụ: sau khi tạo mới nhiệm vụ tất cả user đều nhận được nhiệm vụ\r\n- Quản lý ví tiền: hiển thị số tiền trong ví của mỗi user, hiển thị các yêu cầu rút tiền, duyệt yêu cầu rút tiền tự động trừ tiền trong ví\r\n- Quản lý tin tức/ tự kiện, banner\r\n- Phân quyền quản lý\r\n- Đăng xuất',	NULL,	'2022-01-11 09:46:44',	'2022-02-09 09:22:18',	'Hoàng quan',	'Thả nổi',	'|283|',	'||',	NULL,	302,	NULL,	NULL,	'2022-01-10 09:05:43',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL),
